import React from "react";
import Column from "../Column";

export interface RowProps {
    rows: any
    dataRow: any
    numberRow: number
}

function Row({rows, dataRow, numberRow}: RowProps) {
    return (
        rows.map((elem, index) =>
            ( <tr>
                {Object.keys(elem).map((item, i) => {
                    return <Column value={elem[item]} id={i}/>
                })}
            </tr> )
        )
    )
}

export default Row
